import React from 'react';
import Button from '@mui/material/Button';

function ContentComponent({ subtitle, content }) {
  return (
    <div>
        <p style={{ color: 'white', fontWeight: 'bold', fontSize: '17px' }}>{subtitle}</p>
        <p style={{ color: 'white', fontWeight: 'light', fontSize: '14px', opacity: '60%' }}>{content}</p>
        <Button variant="outlined">Learn more</Button>
    </div>
  )
}

export default ContentComponent;
